import React, { Component } from 'react'
import Todo_Item from './Todo_Item'
import styled from 'styled-components';

const Todo_list = () =>{
    return (
      <Wrapper className='container'>
        {
         this.props.Todo.length===0?<h4 className=''>No Todos to display</h4>:
          this.props.Todo.map(
            (todo) => {
              return <Todo_Item todo = {todo} key = {todo.sno} Delete = {this.props.OnDelete}/>
            }
          )     
        } 
      </Wrapper>
    )
  }

const Wrapper = styled.div`
  display: flex;
  item-align: center;
  justify-content: center;
`;

export default Todo_list
